CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER  VIEW `hyperlink_count_branch` AS SELECT 'Total Enquiries' as status, -1 as Status_id, 'D' as tabname, count(1)AS Total_count,
